  const handleEdit = () => {};
  useEffect 
    (() => {
        Server()
    },
    []);
    const Server=()=>{
        axios.get("http://localhost:3001/users").then((res) => {
            setAlluser(res.data);
          });
    }
    handledelete=(usr)=>{
        axios.delete("http://localhost:3001/users/"+usr.id).then(()=>{
            Server()
        })
    }
  return (
    <div>
      {/* <h1>my Name:{Studentname}</h1>
